    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    bodyend: "</h1>",

}
const Landing = () => {

    return(

        <>
        <p style={styles.tags}>{tags.htmlstart}</p>
        <p style={styles.tags}>{tags.bodystart}</p>

        </>
    )
}
export default Landing
